import logo from './logo.svg';
import './App.css';
import Canvas from  "./components/canvas/canvas"
import Canvas2 from './components/canvas2/canvas2';
import SideBar from './components/sideBar/sidBar';
import { useState } from 'react';
function App() {
  const [number, setNumber] = useState(14);
  const [color, setColor] = useState("#ffffff");
  const [showSideBar, setShowSideBar] = useState(false);
  return (
    <div className="App">
      <Canvas2 number={number} color={color} setShowSideBar={setShowSideBar}/>
      <SideBar setNumber={setNumber} color={color} setColor={setColor} showSideBar={showSideBar}/>
    </div>
  );
}

export default App;
